import React, { Component } from "react";
import Navbar from "./components/navbar/navbar";
import "./App.css";
import background from "./photos/index/WBC_7095.jpg";

class App extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <img alt="Food on a table" id="backgroundImage" />
      </React.Fragment>
    );
  }
}

export default App;
